.info-card {
  margin: 16px 24px 0 24px;
  height: 48px;
  line-height: 12px;
  font-size: 16px;
  font-weight: 600;
}
.form-card {
  margin: 0 24px;
}
/deep/.el-form {
  width: 100%;
  display: flex;
  justify-content: flex-start;
  flex-wrap: wrap;
  .el-form-item {
    width: 50%;
    font-size: 14px;
  }
  .el-input {
    width: 272px;
  }
  .el-input__inner {
    width: 272px;
    height: 32px;
    line-height: 32px;
  }
  .el-textarea {
    width: 272px;
  }
  .el-form-item__label {
    font-size: 14px;
    font-weight: normal;
    text-align: right;
  }
  .amount {
    display: flex;
    .acceptance {
      width: 80px;
      height: 32px;
      margin-top: 5px;
      border: 1px solid #dcdfe6;
      border-left: none;
      text-align: center;
      line-height: 32px;
      font-size: 14px;
      color: #101010;
    }
  }
}
/deep/.el-select-dropdown .el-popper {
  min-width: 150px !important;
}
/deep/ .el-table {
  margin-bottom: 10px;
  .el-table__header {
    height: 48px;
  }
}
/deep/ .el-table td,
.el-table th {
  padding: 0;
  height: 48px;
}
.detail-container {
  margin-left: 16px;
  border-top: 1px dotted #ccc;
}
.el-select-dropdown {
  min-width: 150px !important;
}
/deep/.props-container {
  width: 100%;
  display: flex;
  .el-input__inner {
    width: 150px;
    height: 32px;
    margin-top: 5px;
  }
  .el-input__suffix {
    right: 55px;
    top: -3px;
  }
  div {
    display: flex;
    flex: 1;
    p {
      font-size: 14px;
    }
    .el-button {
      margin-top: 6px;
      height: 32px;
    }
  }
}
/deep/.el-dialog__header {
  height: 48px;
  border-bottom: 1px solid #ccc;
  .el-dialog__title {
    font-size: 16px;
    font-weight: 600;
    display: block;
    height: 100%;
    line-height: 10px;
  }
  .el-dialog__headerbtn {
    top: 15px;
  }
  .el-dialog__footer {
    text-align: left;
  }
}
